    false,nt"url": null,nt"notes": "A series of seismic reflection profiles
    were taken aboard the USC&GSS SURVEYOR during the summer of 1969 as part of a general
    continental shelf survey in the Norton Sound - northern Bering Sea region. The major
    profile lines were run on ten nautical mile (18 kn0 trackline spacing in a northeast-southwest
    direction between Saint Lawrence Island and the Seward Peninsula. The survey area
    was bounded on the west by the U.S. - Russia Convention Line of 1867 and on the
    east by a line connecting Cape Nome and a point approximately 50 miles (90 km) east
    of Southwest Cape, Saint Lawrence Island.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
